import {defineStore} from 'pinia';

const userSessionKey = 'auth-user';

export const useAuthStore = defineStore("auth", {

    state: () => ({
        user: null,
    }),
    actions: {

        initialize() {
            this.user = typeof window !== 'undefined' && JSON.parse(sessionStorage.getItem(userSessionKey)) || null;
        },
        async login(credentials) {
            try {
                const response = await useApi('/auth/login', {method: "POST",data: credentials});
                console.log(response.data)
                if (response && response.data) {
                    this.user = {
                        userId: response.data.value.userId,
                        profile: {
                            name: 'test',
                            position: 'test',
                            profileImage: ''
                        }
                    };
                    if (typeof window !== 'undefined'){
                        sessionStorage.setItem(userSessionKey, JSON.stringify({token: response.data.value.token, ...this.user}));
                    }
                }
                //     return true;
                // } else {
                //     throw new Error('로그인 실패');
                // }


                // this.user = {
                //     'userId': 999,
                //     'profile': {
                //         'name': '김현우',
                //         'position': '법무사',
                //         'profileImage': 'data:image/png;base64, ',
                //         'firmName': '법무사무소'
                //     }
                // }
                // if (typeof window !== 'undefined') {
                //     sessionStorage.setItem(userSessionKey, JSON.stringify(this.user));
                // }


                return true;
            } catch (error) {
                console.log(error);
                // console.error('로그인 실패', error);
                // alert("로그인 실패");
                return false;
            }
        },
        logout() {
            this.user = null;
            // userState.value = null;
            if (typeof window !== 'undefined') {
                sessionStorage.removeItem(userSessionKey);
            }
            console.log("logout !");
            return true;
        }
    }
});